import Phaser from 'phaser'

export default class Scene1 extends Phaser.Scene {
    constructor() {
        super('bootGame')
    }
    preload(){
        this.load.image('background', 'assets/images/background.png');
        // this.load.image('ship', 'assets/images/ship.png');
        // this.load.image('ship2', 'assets/images/ship2.png');
        // this.load.image('ship3', 'assets/images/ship3.png');
        this.load.spritesheet("ship", "assets/spritesheets/ship.png", {
            frameWidth: 16,
            frameHeight: 16
        })
        this.load.spritesheet("ship2", "assets/spritesheets/ship2.png", {
            frameWidth: 32,
            frameHeight: 16
        })
        this.load.spritesheet("ship3", "assets/spritesheets/ship3.png", {
            frameWidth: 32,
            frameHeight: 32
        })
        this.load.spritesheet("explosion", "assets/spritesheets/explosion.png", {
            frameWidth: 16,
            frameHeight: 16
        })
        this.load.spritesheet("power-up", "assets/spritesheets/power-up.png", {
            frameWidth: 16,
            frameHeight: 16
        })
        this.load.spritesheet("player", "assets/spritesheets/player.png", {
            frameWidth: 16,
            frameHeight: 24
        })
        this.load.spritesheet("beam", "assets/spritesheets/beam.png", {
            frameWidth: 16,
            frameHeight:16 
        })

        this.load.bitmapFont('pixelfont', 'assets/font/font.png', 'assets/font/font.xml');

        this.load.audio('audio_beam', ['assets/sounds/beam.ogg', 'assets/sounds/beam.mp3']);
        this.load.audio('audio_explosion', ['assets/sounds/explosion.ogg', 'assets/sounds/explosion.mp3']);
        this.load.audio('audio_pickup', ['assets/sounds/pickup.ogg', 'assets/sounds/pickup.mp3']);
        this.load.audio('music', ['assets/sounds/sci-fi_platformer12.ogg', 'assets/sounds/sci-fi_platformer12.mp3']);



    }
    create() {
        this.add.text(20, 20, "LOADING GAME......")
        this.scene.start('playGame')


        this.anims.create({
            key: 'ship1_anim',
            frames: this.anims.generateFrameNames('ship'),
            frameRate: 20,
            repeat: -1
        })
        this.anims.create({
            key: 'ship2_anim',
            frames: this.anims.generateFrameNames('ship2'),
            frameRate: 20,
            repeat: -1
        })
        this.anims.create({
            key: 'ship3_anim',
            frames: this.anims.generateFrameNames('ship3'),
            frameRate: 20,
            repeat: -1
        })
        this.anims.create({
            key: 'explosion',
            frames: this.anims.generateFrameNames('explosion'),
            frameRate: 20,
            repeat: 0,
            hideOnComplete: true
        });
        this.anims.create({
            key: 'red',
            frames: this.anims.generateFrameNames('power-up', {
                start:0,
                end: 1
            }),
            frameRate: 20,
            repeat: -1,
            hideOnComplete: false
        });
        this.anims.create({
            key: 'gray',
            frames: this.anims.generateFrameNames('power-up', {
                start: 2,
                end: 3
            }),
            frameRate: 20,
            repeat: -1,
            hideOnComplete: false
        });
        this.anims.create({
            key: 'thrust',
            frames: this.anims.generateFrameNames('player'),
            frameRate: 20,
            repeat: -1
        });
        this.anims.create({
            key: 'beam_anim',
            frames: this.anims.generateFrameNames('beam'),
            frameRate: 20,
            repeat: -1
        })
    }
}
